import React from 'react';
import GlobalStyle from './styles/GlobalStyle.js';

import Header from './components/Header';
import FrontPageScene from './components/FrontPageScene';
import About from './components/About';

function App() {
  return (
    <>
      <GlobalStyle />
      <Header />
      <FrontPageScene />
      <About />
    </>
  );
}

export default App;
